class CityResponse {
  CityResponse({
      List<City>? city,}){
    city = city;
}

  CityResponse.fromJson(dynamic json) {
    if (json['city'] != null) {
      city = [];
      json['city'].forEach((v) {
        city?.add(City.fromJson(v));
      });
    }
  }
  List<City>? city;


  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (city != null) {
      map['city'] = city?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}

